"""Xmanager-compatible Experiment Definitions for DPFTRL.


All experiments use batch size 500 and 20 epochs. DPSGD uses noise multipliers
in the grid of (0.498, 0.559, 0.61, 0.715, 0.807, 1.16). Our prefix MF-DP-FTRL
uses a grid of (0.3, 0.4, 0.5, 0.75, 1.0, 2.0) giving epsilons about
21.2, 14.2, 10.8, 6.64, 4.75, 2.17.

Our standard learning rate sweep can be obtain from the following:
```
lr_sweep = []
for i in range(-2, 0, 1):
    lr_sweep.extend([10**i, 2 * 10**i, 5 * 10**i])
return lr_sweep
```

Our 12 repeated runs are obtained via a sweep over the following grid:
```
model_seed=[0, 1], batch_order_seed=[2, 3], noise_seed=[4, 5, 6]
```
"""
from collections.abc import Mapping
import enum
from typing import Any

from multi_epoch_dp_matrix_factorization.dp_ftrl.centralized import xm_fft_experiment_definitions as fft_experiments


@enum.unique
class Experiment(enum.Enum):
  """Experiments for Multi-Epoch paper at: https://arxiv.org/abs/2211.06530."""

  NONPRIVATE_BASE = 'nonprivate_base'
  OPT_PREFIX_SWEEP = 'opt_prefix_sweep'
  TREE_COMPLETE_SWEEP = 'tree_complete_sweep'
  DPSGD_SWEEP = 'dpsgd_sweep'
  REPEATED_OPTIMAL_AND_TREE = 'repeated_optimal_and_tree'
  REPEATED_FFT_OPTIMAL_DECODER = 'repeated_fft_optimal_decoder'
  FFT_OPTIMAL_DECODER_SWEEP = 'fft_optimal_decoder_sweep'
  FFT_REPEATED = 'fft_repeated'
  FFT_SWEEP = 'fft_sweep'
  TREE_COMPLETE_REPEATED = 'tree_complete_repeated'
  DPSGD_REPEATED = 'dp_sgd_repeated'
  DENISOV_SWEEP = 'denisov'
  DENISOV_REPEATED = 'denisov_repeated'
  STAMPING_DENISOV_SWEEP = 'stamping_denisov'
  STAMPING_DENISOV_REPEATED = 'stamping_denisov_repeated'
  STAMPING_DENISOV_TUNE_20 = 'stamping_denisov_tune_20'


