def custom_hparams_to_str(wid: int, parameters: Mapping[Any, Any]) -> str:
  """Forms a string conveying the hyperparameter settings."""
  if not parameters:
    return str(wid)

  ignored_params = ['batch_order_seed', 'model_seed', 'noise_seed']

  name = [
      '{}={}'.format(k, v)
      for k, v in sorted(parameters.items())
      if k not in ignored_params
  ]
  hparams_str = '{}-{}'.format(wid, ','.join(name))

  replace_str = {
      'mechanism': 'mech',
      'learning_rate': 'lr',
      'momentum': 'm',
      'clip_norm': 'clip',
      'exp_short_name': 'exp_name',
      'noise_multiplier': 'noise_m',
      'tmp_ram_fs_size': 'fs',
      'agg=lr_momentum_matrix': '',
      'total_rounds': 'n',
  }
  for c, new_c in replace_str.items():
    hparams_str = hparams_str.replace(c, new_c)
  return hparams_str


def define_parameter_sweep(experiment: Experiment):
  """Switches on experiment key to define parameter sweep."""

  if experiment is Experiment.NONPRIVATE_BASE:
    return _define_cifar10_nonprivate_parameter_sweep()
  elif experiment is Experiment.OPT_PREFIX_SWEEP:
    return _define_cifar10_private_prefixsum_parameter_sweep()
  elif experiment is Experiment.TREE_COMPLETE_SWEEP:
    return _define_tree_with_completion_cifar10_parameter_sweep()
  elif experiment is Experiment.DPSGD_SWEEP:
    return _define_dpsgd_sweep()
  elif experiment is Experiment.REPEATED_OPTIMAL_AND_TREE:
    return _define_repeated_optimal_prefix_and_tree()
  elif experiment is Experiment.REPEATED_FFT_OPTIMAL_DECODER:
    return fft_experiments.define_fft_optimal_decoder_repeated_runs()
  elif experiment is Experiment.FFT_OPTIMAL_DECODER_SWEEP:
    return fft_experiments.define_fft_optimal_decoder_parameter_sweep()
  elif experiment is Experiment.FFT_SWEEP:
    return fft_experiments.define_fft_parameter_sweep()
  elif experiment is Experiment.FFT_REPEATED:
    return fft_experiments.define_fft_repeated_runs()
  elif experiment is Experiment.TREE_COMPLETE_REPEATED:
    return _define_tree_repeated_runs()
  elif experiment is Experiment.DPSGD_REPEATED:
    return _define_dpsgd_repeated()
  elif experiment is Experiment.DENISOV_SWEEP:
    return _define_cifar10_denisov_sweep()
  elif experiment is Experiment.DENISOV_REPEATED:
    return _define_cifar10_denisov_repeated()
  elif experiment is Experiment.STAMPING_DENISOV_SWEEP:
    return _define_stamping_denisov_parameter_sweep()
  elif experiment is Experiment.STAMPING_DENISOV_REPEATED:
    return _define_denisov_stamped_repeated()
  elif experiment is Experiment.STAMPING_DENISOV_TUNE_20:
    return _define_stamping_denisov_parameter_sweep_20()
  else:
    raise ValueError(f'Unknown experiment description: {experiment}')
  # pylint: enable=protected-access
